import React, { Component } from "react";
import ProductItem from "./ProductItem";

export default class ListShoes extends Component {
  render() {
    return (
      <div className="container">
        {this.props.shoesArr.map((item) => {
          <ProductItem shoesItem={item} />;
        })}
      </div>
    );
  }
}
